import {useState} from "react";
import Expense from "./Expense";
import Card from "../UI/Card";
import './Expenses.css'
import ExpensesFilter from "./ExpensesFilter";

const Expenses = (props) => {
    const [selectedYear, setSelectedYear] = useState('');
    const setYear = (setYear) => {
        setSelectedYear(setYear);
        console.log(`We will filter by: ${setYear}`);
    };

    return (
        <div  className="expenses">
            <ExpensesFilter onSelectYear={setYear}/>
            <Card>
                <Expense expense={props.items[0]}/>
                <Expense expense={props.items[1]}/>
                <Expense expense={props.items[2]}/>
                <Expense expense={props.items[3]}/>
            </Card>
        </div>

    );
}

export default Expenses;
